import { useFormik } from 'formik';
import React from 'react';
import './App.css';

function App() {
  const formik = useFormik({
    initialValues: {
      email: '',
    },
    onSubmit: (values) => console.log(values),
  });

  return (
    <div className="App">
      <form>
        <input type="text" name="email" {...formik.getFieldProps('email')} />
        <input type="submit" value="submit" />
      </form>
    </div>
  );
}

export default App;
